import React from 'react';

// Search bar for homepage

 function Navbar(){
    return (
        <React.Fragment>
           <img src={process.env.PUBLIC_URL+"images/mypic.jpg"} alt=""/>
        </React.Fragment>
    )
}

export default Navbar;
